import React, { useState } from 'react';
import { 
  Typography, 
  Paper, 
  Button, 
  Box, 
  TextField, 
  CircularProgress,
  Card,
  CardContent,
  Divider,
  List,
  ListItem,
  ListItemText,
  Chip,
  Alert,
  Snackbar
} from '@mui/material';
import CloudUploadIcon from '@mui/icons-material/CloudUpload';
import { documentsAPI } from '../services/api';

function DocumentAnalysis() {
  const [file, setFile] = useState(null);
  const [fileName, setFileName] = useState('');
  const [isUploading, setIsUploading] = useState(false);
  const [isAnalyzing, setIsAnalyzing] = useState(false);
  const [analysis, setAnalysis] = useState(null);
  const [documentId, setDocumentId] = useState(null);
  const [error, setError] = useState(null);
  const [llmModel, setLlmModel] = useState('gpt-4');

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    if (selectedFile) {
      setFile(selectedFile);
      setFileName(selectedFile.name);
      setAnalysis(null);
      setDocumentId(null);
    }
  };

  const handleUpload = async () => {
    if (!file) return;

    setIsUploading(true);
    setError(null);

    try {
      const formData = new FormData();
      formData.append('file', file);
      formData.append('title', fileName);
      formData.append('description', 'Document uploaded for analysis');

      const response = await documentsAPI.upload(formData);
      setDocumentId(response.data.id);
      setIsUploading(false);
    } catch (err) {
      setError(err.response?.data?.detail || 'Failed to upload document');
      setIsUploading(false);
    }
  };

  const handleAnalyze = async () => {
    if (!documentId) return;

    setIsAnalyzing(true);
    setError(null);

    try {
      const response = await documentsAPI.analyze(documentId, { llm_model: llmModel });
      setAnalysis(response.data);
      setIsAnalyzing(false);
    } catch (err) {
      setError(err.response?.data?.detail || 'Failed to analyze document');
      setIsAnalyzing(false);
    }
  };

  const handleCloseError = () => {
    setError(null);
  };

  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Document Review & Analysis
      </Typography>
      <Typography variant="body1" paragraph>
        Upload legal documents for AI-powered analysis. Get summaries, key points, entity extraction, and recommendations.
      </Typography>

      <Paper elevation={3} sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>
          Upload Document
        </Typography>

        <Box sx={{ display: 'flex', alignItems: 'center', mb: 2 }}>
          <Button
            variant="contained"
            component="label"
            startIcon={<CloudUploadIcon />}
            sx={{ mr: 2 }}
          >
            Select File
            <input
              type="file"
              hidden
              accept=".pdf,.doc,.docx,.txt"
              onChange={handleFileChange}
            />
          </Button>
          <Typography variant="body2">
            {fileName || 'No file selected'}
          </Typography>
        </Box>

        <Box sx={{ display: 'flex', alignItems: 'center' }}>
          <Button 
            variant="contained" 
            color="primary" 
            onClick={handleUpload}
            disabled={!file || isUploading}
            sx={{ mr: 2 }}
          >
            {isUploading ? <CircularProgress size={24} /> : 'Upload'}
          </Button>

          <Button 
            variant="outlined" 
            color="secondary" 
            onClick={handleAnalyze}
            disabled={!documentId || isAnalyzing}
          >
            {isAnalyzing ? <CircularProgress size={24} /> : 'Analyze Document'}
          </Button>
        </Box>
      </Paper>

      {analysis && (
        <Card elevation={3}>
          <CardContent>
            <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
              <Typography variant="h5">Analysis Results</Typography>
              <Chip label={`Model: ${analysis.llm_model}`} color="primary" variant="outlined" />
            </Box>

            <Typography variant="h6">Summary</Typography>
            <Typography variant="body1" paragraph>
              {analysis.summary}
            </Typography>

            <Divider sx={{ my: 2 }} />

            <Typography variant="h6">Key Points</Typography>
            <List dense>
              {analysis.key_points.map((point, index) => (
                <ListItem key={index}>
                  <ListItemText primary={point} />
                </ListItem>
              ))}
            </List>

            <Divider sx={{ my: 2 }} />

            <Typography variant="h6">Entities</Typography>
            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle2">People</Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                {analysis.entities.people.map((person, index) => (
                  <Chip key={index} label={person} />
                ))}
              </Box>
            </Box>

            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle2">Organizations</Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                {analysis.entities.organizations.map((org, index) => (
                  <Chip key={index} label={org} />
                ))}
              </Box>
            </Box>

            <Box sx={{ mb: 2 }}>
              <Typography variant="subtitle2">Dates</Typography>
              <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 1 }}>
                {analysis.entities.dates.map((date, index) => (
                  <Chip key={index} label={date} />
                ))}
              </Box>
            </Box>

            <Divider sx={{ my: 2 }} />

            <Typography variant="h6">Recommendations</Typography>
            <List dense>
              {analysis.recommendations.map((rec, index) => (
                <ListItem key={index}>
                  <ListItemText primary={rec} />
                </ListItem>
              ))}
            </List>
          </CardContent>
        </Card>
      )}

      <Snackbar 
        open={!!error} 
        autoHideDuration={6000} 
        onClose={handleCloseError}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert onClose={handleCloseError} severity="error" sx={{ width: '100%' }}>
          {error}
        </Alert>
      </Snackbar>
    </Box>
  );
}

export default DocumentAnalysis;
